const Container = styled.div`
  width: 100%;

  display: flex;
  align-items: center;
  justify-content: space-between;

  margin-bottom: ${theme.spacing.space.xxxlage};
`;

const NavBar: FunctionComponent = () => {
  return (
    <Container>
      <UserInfo />
      <CreateNewButton />
    </Container>
  );
};

export default NavBar;
